import {StyleSheet} from 'react-native';

export default StyleSheet.create({
  headerLeftContainer: {
    paddingLeft: 10,
  },
  headerRightContainer: {
    paddingRight: 10,
  },
  headerBackIcon: {
    width: 100,
    height: 32,
  },
});
